        mHdltvinHandle << " , " <<  " \"d_i_0_q0\" :  \"" << d_i_0_q0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"d_i_0_address1\" :  \"" << d_i_0_address1.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"d_i_0_ce1\" :  \"" << d_i_0_ce1.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"d_i_0_q1\" :  \"" << d_i_0_q1.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"d_i_1_address0\" :  \"" << d_i_1_address0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"d_i_1_ce0\" :  \"" << d_i_1_ce0.read() << "\" ";
